define({"topics":[{"title":"Create Patch from Local Modifications","shortdesc":"<p class=\"shortdesc\">This is the most commonly used type of patch and contains only the local changes for     the selected item.<\/p>","href":"topics\/create-patch-local-mod_2.html","attributes":{"data-id":"create-patch-local-mod"},"menu":{"hasChildren":false},"tocID":"create-patch-local-mod-d24353e59101","topics":[]},{"title":"Create Patch Against a Specific Revision","shortdesc":"<p class=\"shortdesc\">This type of patch contains changes between an old revision and the current content     from the selected item within the working copy.<\/p>","href":"topics\/create-patch-wc-repository_2.html","attributes":{"data-id":"create-patch-wc-repository"},"menu":{"hasChildren":false},"tocID":"create-patch-wc-repository-d24353e59123","topics":[]},{"title":"Create Patch Between Two Revisions of an Item","shortdesc":"<p class=\"shortdesc\">This type of patch contains historical changes between two revisions of a selected     item.<\/p>","href":"topics\/create-patch-two-revisions-x-svn2.html","attributes":{"data-id":"create-patch-two-revisions"},"menu":{"hasChildren":false},"tocID":"create-patch-two-revisions-d24353e59145","topics":[]},{"title":"Create Patch Between Two Repository Items","shortdesc":"<p class=\"shortdesc\">This type of patch contains changes between one version of an item and a specific     version of another item.<\/p>","href":"topics\/create-patch-repository-x-svn2.html","attributes":{"data-id":"create-patch-repository"},"menu":{"hasChildren":false},"tocID":"create-patch-repository-d24353e59167","topics":[]}]});